import logo from './logo.svg';
import './pico-master/css/pico.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h3>
          Laab es una aplicacion web <code>/React JS</code> que utiliza el poder del gestor de procesos
                                     <code>/Camunda</code> para gestionar los procesos del laboratorio.
        </h3>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
